import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be present
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Wait for the first product card's "Add to Cart" button in the featured products grid
    const addToCartSelector = '#productsGrid .product-card .add-to-cart';
    await page.waitForSelector(addToCartSelector, { timeout: 5000 });

    // Take screenshot before clicking Add to Cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the first "Add to Cart" button
    const addToCartButtons = await page.$$(addToCartSelector);
    if (addToCartButtons.length === 0) {
      throw new Error('No Add to Cart button found in featured products');
    }
    await addToCartButtons[0].click();

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Extract cart count from the cart counter element
    let cartCount = null;
    try {
      await page.waitForSelector('#cartCount', { timeout: 5000 });
      cartCount = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch (e) {
      cartCount = null;
    }

    // Optionally, open the cart modal to verify the product is in the cart
    // Try clicking the cart element (".cart") to open cart modal
    const cartSelector = '.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Take screenshot of the cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modal.png'));

    // Extract product title and quantity from the first cart item
    let cartProductTitle = null;
    let cartProductQuantity = null;
    try {
      // Wait for cart item to appear
      await page.waitForSelector('#cartItems .cart-item', { timeout: 5000 });
      cartProductTitle = await page.$eval('#cartItems .cart-item .cart-item-title', el => el.textContent.trim());
      cartProductQuantity = await page.$eval('#cartItems .cart-item .quantity', el => el.textContent.trim());
    } catch (e) {
      cartProductTitle = null;
      cartProductQuantity = null;
    }

    return {
      success: true,
      action: "Added the first featured product to the cart and verified cart contents.",
      extractedData: {
        cartCount,
        cartProductTitle,
        cartProductQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
